import Head from 'next/head';
import { Container } from '../styles/pages/Home';

import vercel from '../assets/vercel.svg';

export default function Home() {
  return (
    <Container>
      <Head>
        <title>Create Next App</title>
        <link rel="icon" href="/favicon.ico" />
      </Head>

      <main>
        <h1>Hello world</h1>

        <img src={vercel} alt="" />
      </main>
    </Container>
  );
}
